from collections import Counter, defaultdict, deque

from bisect import insort
class Solution:
    def maximumLength(self, s: str) -> int:
        dp = defaultdict(deque)
        dp[s[0]].append(1)
        cur_len = 1
        for i in range(1,len(s)):
            
            if s[i-1] == s[i]:
                cur_len += 1
                
                insort(dp[s[i]], cur_len)
                if len(dp[s[i]]) > 3:
                    dp[s[i]].popleft()
            else:
                cur_len = 1
        
        return dp[max(dp, key=lambda x: dp[x][0])][0]


            




        
